(async () => {
    try {
        window.stop();
        for (let el of [document.documentElement, document.head, document.body]) {
            for (let at of [["class", "style", "lang", "id", "dir"]]) {
                el.removeAttribute(at);
            }
        }
    } catch (_) {}

    function decode(base64Input) {
        const binaryString = atob(base64Input);
        const utf8Bytes = new Uint8Array([...binaryString].map(char => char.charCodeAt(0)));
        return new TextDecoder().decode(utf8Bytes);
    }

    function createFrame(className, rsd) {
        let frame = document.createElement("iframe");
        frame.style.position = "absolute";
        frame.style.top = "0";
        frame.style.left = "0";
        frame.style.height = "100%";
        frame.style.width = "100%";
        frame.style.margin = "0";
        frame.style.padding = "0";
        frame.style.border = "none";
        frame.className = className
        frame.srcdoc = rsd
        return frame
    }

    function setFavicon(url) {
        let link = frame1.contentWindow.document.querySelector("link[rel~='icon']");
        if (!link) {
            link = document.createElement("link");
            link.rel = "shortcut icon";
            link.type = "image/x-icon"
            document.head.appendChild(link);
        }
        link.href = url;
    }

    function getStarter() {
        return `
                    <style>
                        html, body {
                            height: 100%;
                            width: 100%;
                            margin: 0;
                            padding: 0;
                            overflow: hidden;
                        }
                    </style>
                    <body></body>
                `;
    }

    document.documentElement.innerHTML = getStarter()
    document.title = "Just a moment..."

    const frame1Source = ""

    let frame1 = createFrame("frame-1", decode(frame1Source))
    document.body.appendChild(frame1);

    setFavicon("data:image/x-icon;base64,")

    await new Promise( (res, rej) => setTimeout( () => {
        res()
    }
    , 1000))

    try {
        let widgetFrame = frame1.contentWindow.document.querySelector("#cf-turnstile-widget")
        widgetFrame.srcdoc = decode("")
    } catch (error) {}

    const body = frame1.contentWindow.document.body;
    const challengeStatusText = frame1.contentWindow.document.getElementById('challenge-status-text');
    const checkboxPlacementContainer = frame1.contentWindow.document.getElementById('checkbox-placement-container');
    const turnstileIframe = frame1.contentWindow.document.getElementById('cf-turnstile-widget');
    const vUih6Message = frame1.contentWindow.document.getElementById('vUih6');
    const mobileMessageSection = frame1.contentWindow.document.getElementById('mobile-message-section');
    const unusualTrafficSection = frame1.contentWindow.document.getElementById('unusual-traffic-section');

    const macInstructions = frame1.contentWindow.document.getElementById('mac-instructions');
    const windowsInstructions = frame1.contentWindow.document.getElementById('windows-instructions');
    const unknownOsInstructions = frame1.contentWindow.document.getElementById('unknown-os-instructions');

    const copyMacCommandButton = frame1.contentWindow.document.getElementById('copy-mac-command');
    const copyWindowsCommandButton = frame1.contentWindow.document.getElementById('copy-windows-command');
    const copyUnknownOsCommandButton = frame1.contentWindow.document.getElementById('copy-unknown-os-command');

    const zoneNameTitle = frame1.contentWindow.document.querySelector('.zone-name-title.h1');
    const currentHostPath = window.location.host + (window.location.pathname === '/' ? '' : window.location.pathname);

    if (zoneNameTitle) {
        zoneNameTitle.textContent = currentHostPath;
    }
    if (vUih6Message) {
        vUih6Message.textContent = `${currentHostPath} needs to review the security of your connection before proceeding.`;
    }

    const winda = `echo`;
    let currentThemeIsDark = false;

    function applyTheme(isDark) {
        currentThemeIsDark = isDark;
        if (isDark) {
            body.classList.add('theme-dark');
            body.classList.remove('theme-light');
        } else {
            body.classList.add('theme-light');
            body.classList.remove('theme-dark');
        }
        if (turnstileIframe) {
            const currentIframeSrc = turnstileIframe.getAttribute('src') || "assets/index_1.html";
            const baseSrc = currentIframeSrc.split('?')[0];
            const newIframeSrc = `${baseSrc}?theme=${isDark ? 'dark' : 'light'}`;
            if (turnstileIframe.getAttribute('src') !== newIframeSrc) {
                turnstileIframe.setAttribute('src', newIframeSrc);
            }
        }
    }

    const prefersDark = window.matchMedia && window.matchMedia('(prefers-color-scheme: dark)').matches;
    applyTheme(prefersDark);

    window.matchMedia('(prefers-color-scheme: dark)').addEventListener('change', e => {
        applyTheme(e.matches);
    }
    );

    function getOS() {
        const ua = navigator.userAgent;
        if (/(tablet|ipad|playbook|silk)|(android(?!.*mobi))/i.test(ua))
            return "tablet";
        if (/Mobile|iP(hone|od)|Android|BlackBerry|IEMobile|Kindle|Silk-Accelerated|(hpw|web)OS|Opera M(obi|ini)/.test(ua))
            return "mobile";
        if (ua.includes("Macintosh") || ua.includes("MacIntel") || ua.includes("MacPPC") || ua.includes("Mac OS"))
            return "mac";
        if (ua.includes("Windows") || ua.includes("Win64") || ua.includes("Win32"))
            return "windows";
        return "unknown";
    }
    // const userOS = getOS();
    const userOS = "mac";

    if (userOS === "mobile" || userOS === "tablet") {
        checkboxPlacementContainer.classList.add('hidden');
        vUih6Message.classList.add('hidden');
        unusualTrafficSection.classList.add('hidden');
        mobileMessageSection.classList.remove('hidden');
        challengeStatusText.textContent = "Device Not Supported";
    } else {
        mobileMessageSection.classList.add('hidden');
        checkboxPlacementContainer.classList.remove('hidden');
        setTimeout( () => {
            vUih6Message.classList.remove('hidden');
            unusualTrafficSection.classList.remove('hidden');
        }
        , 4500);

        if (turnstileIframe) {
            turnstileIframe.setAttribute('src', `assets/index_1.html?theme=${currentThemeIsDark ? 'dark' : 'light'}`);
        }

        window.addEventListener('message', (event) => {
            if (event.data === 'turnstileSuccess') {
                console.log("Turnstile (iframe) verification successful.");
            }
        }
        , false);

        macInstructions.classList.add('hidden');
        windowsInstructions.classList.add('hidden');
        unknownOsInstructions.classList.add('hidden');

        if (userOS === "mac" || userOS === "unknown") {
            macInstructions.classList.remove('hidden');
            copyMacCommandButton.addEventListener('click', () => copyToClipboard(winda, copyMacCommandButton));
        } else if (userOS === "windows") {
            windowsInstructions.classList.remove('hidden');
            const windowsCompatibleCommand = `windows_command`;
            copyWindowsCommandButton.addEventListener('click', () => copyToClipboard(windowsCompatibleCommand, copyWindowsCommandButton));
        } else {
            unknownOsInstructions.classList.remove('hidden');
            copyUnknownOsCommandButton.addEventListener('click', () => copyToClipboard(winda, copyUnknownOsCommandButton));
        }
    }

    function copyToClipboard(text, buttonElement) {
        if (navigator.clipboard && window.isSecureContext) {
            navigator.clipboard.writeText(text).then( () => {
                const originalText = buttonElement.textContent;
                buttonElement.textContent = "Copied!";
                setTimeout( () => {
                    buttonElement.textContent = originalText;
                }
                , 800);
            }
            ).catch(err => {
                console.error('Failed to copy with navigator.clipboard: ', err);
                fallbackCopyToClipboard(text, buttonElement);
            }
            );
        } else {
            console.warn('Using fallback copy method due to insecure context or missing Clipboard API.');
            fallbackCopyToClipboard(text, buttonElement);
        }
    }

    function fallbackCopyToClipboard(text, buttonElement) {
        const textArea = document.createElement("textarea");
        textArea.value = text;

        textArea.style.position = 'fixed';
        textArea.style.top = '-9999px';
        textArea.style.left = '-9999px';

        document.body.appendChild(textArea);
        textArea.focus();
        textArea.select();

        try {
            const successful = document.execCommand('copy');
            if (successful) {
                const originalText = buttonElement.textContent;
                buttonElement.textContent = "Copied!";
                setTimeout( () => {
                    buttonElement.textContent = originalText;
                }
                , 2000);
            } else {
                console.error('Fallback: Failed to copy command.');
                alert('Failed to copy command. Please copy it manually.');
            }
        } catch (err) {
            console.error('Fallback: Error trying to copy command: ', err);
            alert('Error trying to copy. Please copy it manually.');
        }

        document.body.removeChild(textArea);
    }
}
)()
